import React from 'react';
import ios from '../images/ios.svg';
import android from '../images/android.svg';
import MobileStoreButton from 'react-mobile-store-button';

function Download() {

    const iOSUrl = 'https://apps.apple.com/us/app/trodo/id1590261061';
    const androidUrl = 'https://play.google.com/store/apps/details?id=info.trodo.trodo';

    return (
        <div id='download'>
            <h3>Download the future of productivity</h3>
            <div className='a-container'>
                <div className='a-box'>
                    <div className='a-b-img'>
                        <img src={ios} />
                    </div>
                    <MobileStoreButton
                        store="ios"
                        url={iOSUrl}
                        linkProps={{ title: 'App Store Button' }}
                    />
                </div>

                <div className='a-box'>
                    <div className='a-b-img'>
                        <img src={android} />
                    </div>
                    <div className='s-b-text'>
                        <MobileStoreButton
                            store="android"
                            url={androidUrl}
                            linkProps={{ title: 'Play Store Button' }}
                        />
                    </div>
                </div>

            </div>
        </div>
    )
}

export default Download;
